n          &lt;li&gt; Workers: 8 &lt;/li&gt;\n          &lt;li&gt; Threads: 192 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.35 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"callback":null},"id":"1020","type":"TapTool"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1024","type":"BoxAnnotation"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1408","type":"Panel"},{"attributes":{"tools":[{"id":"1267"},{"id":"1268"},{"id":"1269"}]},"id":"1270","type":"Toolbar"},{"attributes":{},"id":"1023","type":"ResetTool"},{"attributes":{"coordinates":null,"formatter":{"id":"1429"},"group":null,"major_label_policy":{"id":"1430"},"ticker":{"id":"1017"},"visible":false},"id":"1016","type":"LinearAxis"},{"attributes":{},"id":"1017","type":"BasicTicker"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1512","type":"AdaptiveTicker"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1513","type":"AdaptiveTicker"},{"attributes":{"coordinates":null,"data_source":{"id":"1038"},"glyph":{"id":"1067"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1069"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1071"}},"id":"1070","type":"GlyphRenderer"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000
